import React from 'react';
import ReactDOM from 'react-dom';
import './landing.css';
import * as serviceWorker from './serviceWorker';

const Landing = () => {
    return (
        <div class="login">
            <h1>Username</h1>
            <h1>Password</h1>
            <a href="Sign up"/>
        </div>
    );
}

export default Landing;
